import React from "react";
import Card from './Cards';
import Sdata from './Sdata';

function Netflix (){
    return(
        <Card
        key={Sdata[0].id}
        imgsrc={Sdata[0].imgsrc}
        title={Sdata[0].title}
        mname={Sdata[0].mname}
        link={Sdata[0].link}
        />
    );

    }
    export default Netflix;
